column986:
25/May/23 1:42 PM;simon.auch@vodafone.com;This was retestet by team Ash as part of the following ticket: [[PSTASH-965] [OSF] Number porting fees not shown in contract summary - DE Jira (vodafone.com).|https://de.jira.agile.vodafone.com/browse/PSTASH-965]

During analysis we found out that the products are now shown on the contracts summary, but they are not shown correctly (the contract summary is for the product 1V1, but the same issue appears for UMP4/5/6): [^contract_summary_1v1.pdf]
Notice that 1V1 ("Einmalige Vor-Ort-Installationspauschale für Digitalen Kabelanschluss") is shown under the section "Monatliche Zahlungen" while it is a product that is configured to only have a one time charge of 99.99€. Also notice that the sums for the sections "Einmalige Zahlungen" and "Monatliche Zahlungen" is still correct.

Interestingly the display in the checkout overview is correct.

I already contacted OM and requested the CS input xml from them: [^3140_ContractSummary_PK_Cab_xmlOriginal.xml]

Notice the entry for 1V1 mentions a monthly price:
{code:java}
<Fees><Name>Einmalige Vor-Ort-Installationspauschale für Digitalen Kabelanschluss</Name><PriceInfo><SlidingPrice><StartingMonth>1</StartingMonth><MonthlyPriceNoTax>84.0252</MonthlyPriceNoTax><MonthlyPriceIncTax>99.99</MonthlyPriceIncTax></SlidingPrice></PriceInfo></Fees> {code}
After searching through the request archive on the ACC1 I found the following entry (OSE -> OIL):
[https://deosaahw.internal.vodafone.com/Archive/I09/2023/5/22/WSManager/Request/702077_08c1155b-9641-4e55-8550-a3248eb2b757_Request_9a376373-3df3-4f08-9d8a-f396ce687f1c.xml]

 

[^702077_08c1155b-9641-4e55-8550-a3248eb2b757_Request_9a376373-3df3-4f08-9d8a-f396ce687f1c.xml]

Notice the entry for 1V1 mentions a "LinePaymentInterval" REC instead of OTC (one time charge):
{code:java}
<dlc:CommercialProduct><dlc:LineActivityType>ADD</dlc:LineActivityType><dlc:LinePaymentInterval>REC</dlc:LinePaymentInterval><dlc:LineRecurrringChargePeriod/><dlc:PackageSubType>ConfigurableCheckoutOptions</dlc:PackageSubType><dlc:PackageTypeID>cable_tv</dlc:PackageTypeID><dlc:ProductType>simple</dlc:ProductType><dlc:ProductName><![CDATA[ Einmalige Vor-Ort-Installationspauschale für Digitalen Kabelanschluss ]]></dlc:ProductName><dlc:FreightRate>0.00</dlc:FreightRate><dlc:ProductDescription>[1V1] Vor-Ort-Installationspauschale</dlc:ProductDescription><dlc:ProductLaunchDate>1900-01-01</dlc:ProductLaunchDate><dlc:SkuId>1V1</dlc:SkuId><dlc:DeviceID/><dlc:LineTaxClass>TAX_19</dlc:LineTaxClass><dlc:AdvancedBaseFee>N</dlc:AdvancedBaseFee><dlc:AutomaticProlongation>0</dlc:AutomaticProlongation><dlc:FreightRateNetPrice>0.00</dlc:FreightRateNetPrice><dlc:PriceInfo><dlc:StartPeriod>1</dlc:StartPeriod><dlc:EndPeriod/><dlc:NetPrice>84.0252</dlc:NetPrice><dlc:GrossPrice>99.9900</dlc:GrossPrice><dlc:LineTaxClass>TAX_19</dlc:LineTaxClass></dlc:PriceInfo><dlc:Bandwidth> </dlc:Bandwidth><dlc:ScopeList><dlc:Scope>ContractSummary</dlc:Scope></dlc:ScopeList></dlc:CommercialProduct> {code}
 

 

This issue can be reproduced by creating a new customer order at the following address:
{code:java}
<ns2:Strasse>Theresienthaler Str.</ns2:Strasse>
<ns2:Hausnummer>20</ns2:Hausnummer>
<ns2:Hausnummerzusatz>b</ns2:Hausnummerzusatz>
<ns2:Ort>Zwiesel</ns2:Ort>
<ns2:PLZ>94227</ns2:PLZ> {code}
Ordering any GigaTv tariff and selecting "technician needed yes" in the checkout should be sufficient to have 1V1 in the shopping cart.

 

