17/May/23 3:31 PM;rohan.kumbhar@vodafone.com;Seems we have some issue regarding the IPCC flow where issue seems to be in OGW—

I did some investigation and found the below analysis:-

Flow for IPCC :-

Telesales Dialer Flows

Step 1. SetPermission will be triggered from Omnius to OGW

Step 2. based on the unique Transaction id --anycaller will send the Voicefiles to OGW --ArchiveFiles API-- Metadata and Voicefiles

Step 3: OGW will call UM_SET_PERMISSION_CALLBACK and then CreateOptStatement is called to Anypoint

 

